import React from "react";
import Panel from "./panel";

const Dashboard = () => {
  return (
    <div className="dshbrd-1">
      <Panel
        classes={["convex"]}
        style={{
          flex: "0 0 30%",
          padding: "10px",
          height: "300px",
        }}
      ></Panel>
      <Panel classes={["flx-clmn"]} style={{ flex: "0 0 30%" }}>
        <Panel
          classes={["convex"]}
          style={{ flex: "0 0 30%", padding: "10px" }}
        ></Panel>
        <Panel
          classes={["concave"]}
          style={{ flex: "0 0 70%", padding: "10px" }}
        ></Panel>
      </Panel>
      <Panel classes={["asdsad"]} style={{ flex: "0, 0, 40%" }}>
        <Panel style={{ flex: "0, 0, 33%" }} classes={["flx-clmn"]}>
          <Panel style={{ flex: "0, 0, 30%" }}></Panel>
          <Panel style={{ flex: "0, 0, 30%" }}></Panel>
          <Panel style={{ flex: "0, 0, 40%" }} classes={["convex"]}></Panel>
        </Panel>
        <Panel style={{ flex: "0, 0, 33%" }} classes={["flx-clmn"]}>
          <Panel style={{ flex: "0, 0, 40%" }} classes={["convex"]}></Panel>
          <Panel style={{ flex: "0, 0, 30%" }}></Panel>
          <Panel style={{ flex: "0, 0, 30%" }}></Panel>
        </Panel>
        <Panel style={{ flex: "0, 0, 33%" }} classes={["flx-clmn"]}>
          <Panel style={{ flex: "0, 0, 30%" }}></Panel>
          <Panel style={{ flex: "0, 0, 40%" }} classes={["convex"]}></Panel>
          <Panel style={{ flex: "0, 0, 30%" }}></Panel>
        </Panel>
      </Panel>
    </div>
  );
};

export default Dashboard;
